import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const GradesScreen = () => {
  return (
    <View>
      <Text>GradesScreen</Text>
    </View>
  )
}

export default GradesScreen

const styles = StyleSheet.create({})
